  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset represents locations that
  have been stocked with fish by the California Department of Fish and Wildlife during
  the current year and the two preceeding years. Each feature in this dataset represents
  a California Department of Fish and Wildlife hatchery's inland program fish stocking
  release water as described in the California Department of Fish and Wildlife Statewide
  Hatchery Database (HAT). Release water is defined as surface water where fish stocking
  took place. A single release water may be a moving water such as a portion of a
  stream or river, or a non-moving water such as a lake, reservoir, or pond. Note
  that there may be multiple fish planting sites on a designated water during a stocking
  event but these individual sites are not represented in this dataset.\",\n\t\"license_title\":
